import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Frontend';
}
<mat-toolbar>
  <span>My App</span>
  <span class="example-spacer"></span>
  <button mat-raised-button>
    NOVO EVENTO
  </button>
</mat-toolbar>

<router-outlet></router-outlet>
